import React, { Component } from 'react';
import "./searchbar.css"

export default class SearchBar extends Component {
    render() {
        return (
            <div>
                <form>
                    <input placeholder="Pokemon" className="SearchBar"/>
                </form>
            </div>
        );
    }
}
